    func testMixedModel_ToStringJSON() {
        let _mixObject: STCMixedModel? = STCMixedModel.shared

        // Positive
        assertNoThrow {
            self.printTimeElapsedWhenRunningCode(title: #function) {
                for _ in 1...100 {

                    // Encode
                    let jsonString = _mixObject?.toJSONString()

                    // Decode
                    var _mixResult: STCMixedModel?
                    if let string = jsonString {
                        _mixResult = try? STCMixedModel(from: string)
                    }
                    XCTAssertEqual(_mixObject, _mixResult)
                }
            }
        }
    }

    func testMixedModel_ToStringJSON_TSC() {
        let _mixObject: STCMixedModel! = STCMixedModel.shared

//        let _mixObject: JsonObject! = Mapper<ValidatableModel>
//                .parseJSONStringIntoDictionary(JSONString: Inner.JsonString_VTBArmenia)

        // Positive
        assertNoThrow {
            let policy: CodingFailurePolicy = .raiseException
            self.printTimeElapsedWhenRunningCode(title: #function) {
                for _ in 1...100 {

                    // Encode
                    let mdata = NSMutableData()
                    TypedStreamEncoder(forWritingInto: mdata, failurePolicy: policy).encode(_mixObject)
                    XCTAssertNotEqual(mdata, NSMutableData())

                    // Decode
                    var _mixResult: STCMixedModel?
                    if let value = TypedStreamDecoder(forReadingFrom: mdata as Data, failurePolicy: policy).decodeObject() as? STCMixedModel {
                        _mixResult = value
                    }
                    XCTAssertEqual(_mixObject, _mixResult)
                }
            }
        }
    }

    func testMixedModel_ToStringJSON_MPC() {
        let _mixObject: STCMixedModel! = STCMixedModel.shared

//        let _mixObject: JsonObject! = Mapper<ValidatableModel>
//                .parseJSONStringIntoDictionary(JSONString: Inner.JsonString_VTBArmenia)

        // Positive
        assertNoThrow {
            self.printTimeElapsedWhenRunningCode(title: #function) {
                for _ in 1...100 {

                    // Encode
                    let mdata = try! MPMessagePackWriter.write(Mapper().toJSON(_mixObject))
                    XCTAssertNotNil(mdata)
                    XCTAssertNotEqual(mdata, NSMutableData())

                    // Decode
                    var _mixResult: STCMixedModel?
                    if let value = try? MPMessagePackReader.read(mdata as Data) as! JsonObject {
                        _mixResult = try? STCMixedModel(from: value)
                    }
                    XCTAssertEqual(_mixObject, _mixResult)

                }
            }
        }
    }

