    func testJsonString_Taxi777_TSC() {

        let _dictObject: JsonObject! = Mapper<ValidatableModel>
                .parseJSONStringIntoDictionary(JSONString: Inner.JsonString_Taxi777)

        // Positive
        assertNoThrow {
            let policy: CodingFailurePolicy = .raiseException

            // Encode
            let mdata = NSMutableData()
            TypedStreamEncoder(forWritingInto: mdata, failurePolicy: policy).encode(_dictObject)
            XCTAssertNotEqual(mdata, NSMutableData())

            // Decode
            var _dictResult: JsonObject?
            if let value = TypedStreamDecoder(forReadingFrom: mdata as Data, failurePolicy: policy).decodeObject() as? JsonObject {
                XCTAssertTrue(NSDictionary(dictionary: _dictObject).isEqual(to: value))
                _dictResult = value
            }
            XCTAssertNotNil(_dictResult)
        }
    }

